import React from 'react'
import {Link,Outlet} from'react-router-dom';

function Dashboard() {
  return (
    <div>
        <nav>
            <Link to='create'>Create</Link>
        </nav>
        <Outlet/>
    </div>
  )
}

export default Dashboard
